import React from 'react';
import searchValues from "../assets/component-list.json";
 

import { useSnackbar } from '../components/UI';
 

export default function useApp() {
 
  const search = param => {
    return ((found) => {
      searchValues.map()
      return found;
    })([])
  }
  
 
  const { snackState, say } = useSnackbar();
 
  return { snackState, say };
}
